import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { act, Actions, createEffect, Effect, ofType } from '@ngrx/effects';
import { Store } from '@ngrx/store';
import { ToastrService } from 'ngx-toastr';
import { EMPTY, of } from 'rxjs';

import { catchError, map, switchMap, tap } from 'rxjs/operators';

import { AppState } from '../../store/app.state';
import { User } from '../../store/models/user.model';
import { AuthService } from '../services/auth.service';
import { AuthActions } from '.';
import { LogIn, LogInFailure, LogInSuccess } from './auth.actions';

@Injectable()
export class AuthEffects {
  logIn$ = createEffect(() =>
    this._actions$.pipe(
      ofType(AuthActions.LogIn),
      switchMap(({ email, password }) =>
        this._authService.login(email, password).pipe(
          map((data) => {
            localStorage.setItem('access_token', data.access_token);
            localStorage.setItem('expires', data.expires);
            localStorage.setItem('refresh_token', data.refresh_token);
          }),
          switchMap((noop) =>
            this._authService.me().pipe(
              tap((user) => localStorage.setItem('user', JSON.stringify(user))),
              map((user) => {
                return LogInSuccess({ user: user })}),
              catchError((error) => {
                debugger;
                error.errors.forEach((error) => {
                  this._toastr.error(error.message, 'Erreur');
                });
                return of(LogInFailure({ error }));
              })
            )
          ),

        )
      )
    )
  );

  logInSuccess$ = createEffect(
    () =>
      this._actions$.pipe(
        ofType(AuthActions.LogInSuccess),
        map((action) => {
          this._router.navigate(['/']);
        })
      ),
    { dispatch: false }
  );

  logInFailure$ = createEffect(
    () =>
      this._actions$.pipe(
        ofType(AuthActions.LogInSuccess),
        map((action) => {})
      ),
    { dispatch: false }
  );

  logOut$ = createEffect(
    () =>
      this._actions$.pipe(
        ofType(AuthActions.LogOut),
        tap((action) => {
          localStorage.removeItem('user');
          this._router.navigate(['/login']);
        })
      ),
    { dispatch: false }
  );

  constructor(
    private _actions$: Actions,
    private _authService: AuthService,
    private _router: Router,
    private _toastr: ToastrService
  ) {}
}

import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { map, Observable, tap } from 'rxjs';
import { User } from 'src/app/store/models/user.model';
import { environment } from 'src/environments/environment';

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  constructor(private http: HttpClient) {}

  register(user: User): Observable<boolean> {
    return this.http.post<any>(`${environment.api}/users`, user);
  }

  login(email: string, password: string): Observable<any> {
    return this.http
      .post<any>(`${environment.api}/auth/local/signin`, {
        email,
        password,
      });
  }

  refresh(): Observable<any> {
    return this.http
      .post<any>(`${environment.api}/auth/refresh`, {}).pipe(tap((response) => {
        localStorage.setItem('access_token',response.access_token);
        localStorage.setItem('refresh_token',response.refresh_token);
      }));
  }

  logout(): Observable<any> {
    return this.http
      .post(`${environment.api}/auth/logout`, {
        id : JSON.parse(localStorage.getItem('user')).id,
      })
      .pipe(
        tap((response) => {
          localStorage.clear();
        })
      );
  }

  me(): Observable<User> {
    return this.http
      .get<User>(`${environment.api}/auth/me`)
  }
}

import { HttpClient, HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { map, Observable } from 'rxjs';
import { ShoppingList } from 'src/app/shopping-lists/state/shopping-list';
import { ProductInList } from 'src/app/store/models/product-in-cart.model';
import { environment } from 'src/environments/environment';

@Injectable({
  providedIn: 'root',
})
export class CartService {
  constructor(private http: HttpClient) {}

  getCurrentList() : Observable<ShoppingList>{
    let params : HttpParams = new HttpParams()
    .append('fields', '*,product.*,product.products_id.*,product.unit.*')
    .append('filter', JSON.stringify({status : { _eq : 'draft'}}));
    return this.http.get<any>(`${environment.api}/items/shopping_list`, { params }).pipe(
      map((envelope: any) => envelope.data[0])
    );
  }

  patchShoppingList(shoppingList: ShoppingList) {
    return this.http
      .patch<any>(`${environment.api}/items/shopping_list/${shoppingList.id}`, shoppingList)
      .pipe(map((envelope: any) => envelope.data));
  }

  createShoppingList(shoppingList: ProductInList[]) {
    let products = [];

    shoppingList.map((productInList: ProductInList) => {
      let products_id = productInList.product.id;
      products.push({
        products_id,
        quantity: productInList.quantity,
        unit: productInList.unit,
      });
    });
    return this.http
      .post<any>(`${environment.api}/items/shopping_list`, {
        product: products,
      })
      .pipe(map((envelope: any) => envelope.data));
  }
}

import { Injectable } from '@angular/core';
import { HttpClient, HttpRequest, HttpEvent } from '@angular/common/http';
import { Observable } from 'rxjs';
import { environment } from 'src/environments/environment';

@Injectable({
  providedIn: 'root'
})
export class FileUploadService {
  private baseUrl = 'http://localhost:8080';

  constructor(private http: HttpClient) { }

  upload(filename: string,file: File): Observable<HttpEvent<any>> {
    const formData: FormData = new FormData();

    formData.append('title',filename);
    formData.append('file', file);

    const req = new HttpRequest('POST', `${environment.api}/files`, formData, {
      reportProgress: true,
      responseType: 'json'
    });

    return this.http.request(req);
  }

  getFiles(): Observable<any> {
    return this.http.get(`${environment.api}}/files`);
  }
}

