import { Injectable } from '@angular/core';
import {
    HttpEvent, HttpInterceptor, HttpHandler,
    HttpRequest, HttpErrorResponse
} from '@angular/common/http';
import { throwError, Observable, BehaviorSubject, Subject } from 'rxjs';
import { catchError, filter, take, switchMap, finalize } from 'rxjs/operators';
import { ToastrService } from 'ngx-toastr';
import { AuthService } from 'src/app/auth/services/auth.service';
import { Router } from '@angular/router';


@Injectable()
export class SecurityInterceptor implements HttpInterceptor {

    private AUTH_HEADER = 'Authorization';

    private refreshTokenInProgress = false;
    private refreshTokenSubject: BehaviorSubject<any> = new BehaviorSubject<any>(null);


    constructor(private authSrv: AuthService, private _router: Router) { }

    intercept(req: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
        if(!req.url.includes('signin') && !req.url.includes('signup')){
            req = this.addAuthenticationToken(req);
        }

        if(this.refreshTokenInProgress){
            return this.refreshTokenSubject.pipe(
                switchMap(() => next.handle(this.addAuthenticationToken(req)))
            )
        } else {
            return next.handle(req).pipe(
                catchError((error: HttpErrorResponse) => {
                    if(error.status === 401){
                        this.refreshTokenInProgress = true;
                        this.refreshTokenSubject = new BehaviorSubject<any>(null);

                        return this.refreshAccessToken().pipe(
                            switchMap(() => {
                                debugger;
                                this.refreshTokenInProgress = false;
                                this.refreshTokenSubject.next(null);
                                return next.handle(this.addAuthenticationToken(req))
                            }),
                            catchError((error: HttpErrorResponse) => {
                                this.refreshTokenInProgress = false;
                                this.refreshTokenSubject.error(error);
                                this._router.navigate(['/auth/login']);
                                return throwError(() => new HttpErrorResponse(error));
                            })
                        );
                    } else {
                        return throwError(() => new HttpErrorResponse(error));
                    }
                })
            );
        }
    }

    private addAuthenticationToken(req: HttpRequest<any>): HttpRequest<any> {
        let tokenKey = 'access_token';
        if(req.url.search('/refresh') !== -1){
            tokenKey = 'refresh_token'
        }
        const jwtToken = localStorage.getItem(tokenKey);
        //console.log(`Using access token: ${jwtToken}`);
        if (jwtToken) {
            const cloned = req.clone({
                headers: req.headers.set(this.AUTH_HEADER, 'Bearer ' + jwtToken)
            });
            return cloned;
        } else {
            return req;
        }
       
    }

    private refreshAccessToken(): Observable<any> {
        return this.authSrv.refresh();
    }
}

